import React from 'react';
import { NavLink } from 'react-router-dom';
import navlink from '../assets/Nav-link.png';

export default function Navbar() {
  return (
    <nav>
      <div className='navbar-logo'>
        <img src={navlink} alt='nav-link' className='Nav-Link' />
        <ul className='move-navbar'>
          <li>
            <NavLink to='/' exact className='red-color navbar' activeClassName='active-nav-item'>
              Accueil
            </NavLink>
          </li>
          <li>
            <NavLink to='/about' className='red-color navbar' activeClassName='active-nav-item'>
              A propos
            </NavLink>
          </li>
        </ul>
      </div>
    </nav>
  );
}
